          </ul> 
     );
};
const AppHeader = () =>{
     return  <h1>My Todo List</h1>
    };

const SearchPanel = () =>{
     const searchText = 'Text here to search'
     return <input placeholder="search" />;
};
const App = () => {

     return (
          <div>
          <AppHeader />
